      message.success('Login Successful !');
   };

   return (
    <div className="appBg">
      <Form className='loginForm' onFinish={login}>
         <Typography.Title>Welcome Back !</Typography.Title>
         <Form.Item rules={[
            {
               required: true,
               type: "email",
               message: "Please enter valid email",
